import React from "react";
import { useAuth } from './../../context/Authcontext';

import { Outlet, Navigate, useNavigate } from "react-router-dom";

function Guestlayout() {
const { user } = useAuth();
  const Navigate = useNavigate();
  if (!user) {
    return <Outlet />;
  } else {
    Navigate("/dashboard");
  }
}

export default Guestlayout;
